create table business
(
    businessId      int unsigned auto_increment comment '商家编号'
        primary key,
    businessName    varchar(40)                not null comment '商家名称',
    businessAddress varchar(50)                null comment '商家地址',
    businessExplain varchar(40)                null comment '商家介绍',
    businessImg     mediumtext                 not null comment '商家图片（base64）',
    orderTypeId     int                        not null comment '点餐分类',
    starPrice       decimal(5, 2) default 0.00 null comment '起送费',
    deliveryPrice   decimal(5, 2) default 0.00 null comment '配送费',
    registerTime    datetime                   null comment '商家注册时间',
    userId          int                        not null,
    remarks         varchar(40)                null comment '备注',
    delTag          int           default 1    not null comment '删除标记（1：正常； 0：删除）'
)
    charset = utf8mb3;

create table cart
(
    cartId     int auto_increment comment '购物车编号'
        primary key,
    foodId     int null comment '食品编号',
    businessId int null comment '所属商家编号',
    userId     int null comment '所属用户编号',
    quantity   int null comment '同一类型食品的购买数量'
)
    charset = utf8mb3;

create table deliveryaddress
(
    daId        int auto_increment comment '送货地址编号'
        primary key,
    contactName varchar(20)   not null comment '联系人姓名',
    contactSex  int           not null comment '联系人性别',
    contactTel  varchar(20)   not null comment '联系人电话',
    address     varchar(100)  not null comment '送货地址',
    userId      int           not null comment '所属用户编号',
    delTag      int default 1 not null comment '删除标记（1：正常； 0：删除）'
)
    charset = utf8mb3;

create table food
(
    foodId      int auto_increment comment '食品编号'
        primary key,
    foodName    varchar(30)   not null comment '食品名称',
    foodExplain varchar(30)   not null comment '食品介绍',
    foodImg     mediumtext    not null comment '食品图片',
    foodPrice   decimal(5, 2) not null comment '食品价格',
    businessId  int           not null comment '所属商家编号',
    createTime  datetime      null comment '创建时间',
    remarks     varchar(40)   null comment '备注',
    delTag      int default 1 not null comment '删除标记（1：正常； 0：删除）'
)
    charset = utf8mb3;

create table orderdetailet
(
    odId     int auto_increment comment '订单明细编号'
        primary key,
    orderId  int not null comment '所属订单编号',
    foodId   int not null comment '食品编号',
    quantity int not null comment '数量'
)
    charset = utf8mb3;

create table orders
(
    orderId    int auto_increment comment '订单编号'
        primary key,
    userId     int                        not null comment '用户编号',
    businessId int                        not null comment '商家编号',
    orderDate  varchar(255)               not null comment '订购日期',
    orderTotal decimal(7, 2) default 0.00 not null comment '订单总价',
    daId       int                        not null comment '送货地址编号',
    orderState int           default 0    not null comment '订单状态（0：未支付； 1：已支付）',
    delTag     int           default 1    not null comment '删除标记（1：正常； 0：删除）'
)
    charset = utf8mb3;

create table user
(
    userId       int auto_increment comment '用户编号'
        primary key,
    username     varchar(255)  null comment '用户名称',
    email        varchar(255)  null comment '用户邮箱',
    password     varchar(255)  null comment '用户密码',
    role         varchar(255)  null comment '角色',
    registerTime datetime      null comment '注册时间',
    userSex      int default 1 not null comment '用户性别（1：男； 0：女）',
    userImg      mediumtext    null comment '用户头像',
    delTag       int default 1 not null comment '删除标记（1：正常； 0：删除）',
    constraint unique_email
        unique (email),
    constraint unique_username
        unique (username)
)
    charset = utf8mb3;

